description:
Allie was hard at it trying to really master her instrument while her hard ass piano instructor was breathing down her neck. No matter what she did, she just could not get this one part right and that frustrated the hell out of her teacher. She made the grave mistake of talking back and giving her teacher Tanya some attitude. In a fit of stress and rage she grabbed Allie &amp; taught her never to talk back.

